        for (var entry = 0; entry < data2.length; entry++) {

          var hash = data2[entry].Lineup;
          var timestamp = new Date(data2[entry].Timestamp['_d']);
          var lineup = data2[entry].Lineup.split('-');
          
          for (var row = 0; row < lineup.length; row++) {

            lineup[row] = lineup[row].match(/.{1,2}/g);
          }

          data2[entry] = {

            timestamp: timestamp,

          };

        countPlayers(data2);

        function countFormations(data2) {

          // Most common formation
          var formations = []

          for (var entry = 0; entry < data2.length; entry++) {

            var formation = [];

            var lineup = data2[entry].lineup;
            lineup.pop()
            lineup.reverse();

            for (var row = 0; row < lineup.length; row++) {

              formation.push(lineup[row].length);
            }

            formations.push(formation.join('-'))
          }

          console.log(count(formations));
        }

        function countPlayers(data2) {

          var players = []

          for (var entry = 0; entry < data2.length; entry++) {


            players.push(flatten(data2[entry].lineup));
          }

          players = flatten(players);

          console.log(count(players));
        }

        function flatten(arr) {

          var flat = [];

          return flat.concat.apply(flat, arr);
        }

        function count(arr) {

          var counts = {};

          arr.forEach( function(n) {

            counts[n] = (counts[n] || 0) + 1;
          });

          return counts;
        }

        
        document.getElementById('get-data').onclick = getData;
        document.getElementById('save-file').onclick = saveFile;

        function getData() {

          var ds = new Miso.Dataset({

            importer: Miso.Dataset.Importers.GoogleSpreadsheet,
            parser: Miso.Dataset.Parsers.GoogleSpreadsheet,
            key: key,
            worksheet: worksheet
          });

          ds.fetch({

            success : function() {

              data = ds.toJSON();

              outputData(JSON.stringify(data));
            },
            error : function() {

              outputData("Daten konnten nicht geladen werden. Vielleicht sind Sie nicht mit dem Internet verbunden oder das Spreadsheet wurde nicht veröffentlicht.");
            }
          });
        }

        function outputData(string) {

          document.getElementById('result').textContent = string;
          blob = new Blob([string], {type: 'application/json;charset=utf-8'});
        }

        function saveFile() {

          if (blob) {

            saveAs(blob, 'data.json');
          } else {

            getData();
          }
        }
